Days Missing Vol. 2: Kestus - Collected Edition

English | CBR | 1 Issue

Genre: Science Fiction

Written Phil Hester
Art by Frazer Irving
Cover by Alex Ross

Collects Days Missing Vol. 1 #1-5!

Includes a cover gallery and sketchbook. Includes an introduction by Warren Ellis! 

Collects issues #1-5, plus an intro by Wil Wheaton and an afterword by Trevor Roth!

The Steward, a mysterious being with the ability to 'fold' days of time, has caused critical human events to be absent from the historical record. Their existence is not remembered, but the occurrences of these days have forever changed the course of evolution. Since humanity's birth, The Steward has stood as a guiding force for our species. But now, he is not alone! The emergence of the ancient being, Kestus, may put everything he knows in question, and the future of those he means to protect in jeopardy.

